import React from 'react';
import {Card} from "@mui/material";
import {Grid} from "@mui/material";

const Main = () => {
    return(
        <Card>
            <Grid container spacing={2}>
                <Grid item xs={8}>
                </Grid>
                <Grid item xs={4}>
                </Grid>
                <Grid item xs={4}>
                </Grid>
                <Grid item xs={8}>
                </Grid>
            </Grid>
        </Card>
    )
}
export default Main
